import React from 'react'
import { Modal } from 'react-bootstrap'
import Banner from './Banner'

export default function BannerModal({ show, onHide, ...bannerProps }) {
  return (
    <Modal show={show} onHide={onHide} centered>
      <Modal.Body>
        <Banner {...bannerProps} onClose={onHide} />
      </Modal.Body>
    </Modal>
  )
}
